import { AppBar, Box, Card, Container, Grid, Toolbar, Typography } from "@mui/material";
import Cards from "./Cards";

const Driver = () => {
  return (
    <>
    <Box sx={{display: "flex"}}>
    <AppBar position="fixed" children={
        <Toolbar>
            <Typography variant="h6" component="div">
                CRUD App
            </Typography>
        </Toolbar>
    } />
    <Box 
        component="main"
        sx={{
        backgroundColor: (theme) =>
            theme.palette.mode === 'light'
            ? theme.palette.grey[100]
            : theme.palette.grey[900],
        flexGrow: 1,
        height: '100vh',
        width: '100vh',
        overflow: 'auto',
        }}
    >
    <Toolbar />
    <Container maxWidth="xl" sx={{ mt: 4, mb: 4 }}>
        <Grid  container spacing={3}>
            <Grid item xs={120} md={100} lg={100}>
                <Cards />
            </Grid>
            <Grid item xs={12} md={4} lg={3}>
                <Cards />
            </Grid>
        </Grid>


    </Container>
    </Box>
    </Box>
    </>
  )  
};

export default Driver;
